package com.zhzx.dao.bean.prod;import com.zhzx.dao.bean.BaseBean;public class ProdProperty extends BaseBean {		/**	*商品属性编号	*/	private String id;		/**	*商品编号	*/	private String prodNo;		/**	*属性key	*/	private String key;		/**	*属性名称	*/	private String name;		/**	*属性值	*/	private String value;		/**	*属性描述	*/	private String discribe;		/**	*属性扩展字段	*/	private String extend;		/**	*属性状态（有效：1，无效0）	*/	private String status;			public String getId() {	    return this.id;	}	public void setId(String id) {	    this.id=id;	}	public String getProdNo() {	    return this.prodNo;	}	public void setProdNo(String prodNo) {	    this.prodNo=prodNo;	}	public String getKey() {	    return this.key;	}	public void setKey(String key) {	    this.key=key;	}	public String getName() {	    return this.name;	}	public void setName(String name) {	    this.name=name;	}	public String getValue() {	    return this.value;	}	public void setValue(String value) {	    this.value=value;	}	public String getDiscribe() {	    return this.discribe;	}	public void setDiscribe(String discribe) {	    this.discribe=discribe;	}	public String getExtend() {	    return this.extend;	}	public void setExtend(String extend) {	    this.extend=extend;	}	public String getStatus() {	    return this.status;	}	public void setStatus(String status) {	    this.status=status;	}}